import React from 'react';
import { View, Text } from 'react-native';

const ListHorarios = ({ navigation ,  route }) => {
  // Accede a los datos pasados como par√°metro
  const { datos } = route.params;

  return (
    <View>
      <Text>Estos son los datos recibidos:</Text>
      <Text>{JSON.stringify(datos)}</Text>
    </View>
  );
};

export default ListHorarios;
